import React from 'react'

export function tableRowSelect(id) {
  return {
    key: 'select',
    component: ({ handleChange }) => (
      <td style={{ width: '48px' }}>
        <input
          name={id}
          type="checkbox"
          checked={selected.includes(id)}
          onChange={handleChange}
          style={{ cursor: 'pointer' }}
        />
      </td>
    ),
  }
}
